import { Typography ,TextField} from '@mui/material';
import React from 'react';
import styled from 'styled-components';


const FullScreenContainer = styled('div')`
  height: 100vh;
  width: 100vw;
  display: flex;
  justify-content: center;
  align-items: center;
  background-color: #eeeeee; /* Optional: Set a background color */
`;

const StyledPaper = styled('div')`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 32px 64px;
  max-width: 500px;
  width: 28.5rem;
  background-color: white;
  border-radius: 16px;
`;

const StyledTypography = styled('div')`
  display: flex;
  width:328px;
  height:33px;
  justify-content: center;
  font-weight: 800;
  line-height: 1.2;
  font-size: 1.75rem;
  font-family: Baikal, Inter, sans-serif;
  letter-spacing: -0.025em;
  text-align: center;
  margin: 0.5rem 0px 1.25rem;
`;
const StyledForm=styled('div')`

width:328px;
margin:2px;
 
  
`
const StyledInput= styled('div')`
 text-align:left;
 width:inherit;


`
const StyledText=styled('div')`
color: rgb(58, 58, 58);
    font-size: 0.75rem;
    margin-bottom: 0.3rem;
    display: inline-block;
    font-weight:500;
      letter-spacing: -0.01em;

`

const StyledTextField = styled(TextField)`
  && {
    width: 100%;
    margin-bottom: 1rem;
    
    & .MuiInputBase-root {
      padding: 0px 16px;
      height: 3rem;
      display: flex;
      align-items: center;
      font-size: 1rem;
      color: rgb(12, 12, 12);
      font-weight: 500;
      border-radius: 8px;
      border: 1px  rgb(206, 206, 206); 
      background: rgb(255, 255, 255);
      transition: border-color 100ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;
    }

    & .MuiOutlinedInput-notchedOutline {
    border-color: rgb(203 213 225);
    }

    & .MuiOutlinedInput-root.Mui-focused .MuiOutlinedInput-notchedOutline {
    border-color: rgb(226 232 240);
      outline: rgba(26, 158, 233, 0.25) solid 2px;
      transition: border-color 300ms cubic-bezier(0.4, 0, 0.2, 1) 0ms, outline 300ms cubic-bezier(0.4, 0, 0.2, 1) 0ms;
    }

    & .MuiFormLabel-root {
    
      font-weight: 500;
    }
  }
`;
const StyledBottomText=styled('div')`
 font-size: 0.75rem;
    line-height: 1.4;
    font-family: Inter, sans-serif;
    margin: 1rem 0px 0.25rem;
    font-weight: 500;
}

`
export const Login = () => {
  return (
    <FullScreenContainer>
      <StyledPaper>
        <StyledTypography>
          Log in
        </StyledTypography>
       <StyledForm>
          <StyledInput>
            <StyledText>
              Email or Mobile Number
            </StyledText>
            <StyledTextField
               variant='outlined'
               placeholder='Email or Mobile Number'
            />
            <StyledBottomText>
            By clicking Continue, you agree to our  Terms & Conditions and Privacy Policy
            </StyledBottomText>

        
          </StyledInput>
          
       </StyledForm>
      </StyledPaper>
    </FullScreenContainer>
  );
};
